import React from 'react';
import styled from "styled-components";
import hk from './hk.jpg';

export const App = () => {
  return (
    <Background>
      <Container>
<FrontPage>
<h1>Soliman Doe
DESIGNER DEVELOPER FREELANCER
    </h1>
</FrontPage>
<About>
<h1> Hi there, I'm Soliman Doe</h1>
</About>
      </Container>
    </Background>
  )
}


const Background = styled.main`
background-image: linear-gradient(rgba(0, 0, 0, 0.5), rgba(0, 0, 0, 0.5)), url(${hk});
background-position: center;
background-repeat: no-repeat;
background-size: cover;
position: fixed;
height: 100%; 
width: 100%; 
`

const Container = styled.div`
position: relative; 
`
const FrontPage = styled.div`
height: 100vh; 
display: flex; 
justify-content: center; 
align-items: center; 
position: relative; 

`

const About = styled.div`
height: 100vh; 
position: relative; 


`
